import React, { useEffect, useState } from 'react';
import { Table } from  'reactstrap';

function TopList(props){
    
    useEffect(() => {
        console.log(props)
    }, []);

    return (
        <Table hover>
            <thead>
                <tr>
                    <th>#</th>
                    <th>Artista</th>
                    <th>Ouvintes</th>
                    <th>?</th>
                </tr>
            </thead>
            <tbody>
                {
                    props.artistas.map((artista) => {
                        return(
                            <tr>
                                <th scope="row">1</th>
                                <td>{artista.name}</td>
                                <td>{artista.listeners}</td>
                                <td></td>
                            </tr>
                        );
                    })
                }
            </tbody>
        </Table>
    );
}

export default TopList;
